import logo from './logo.svg';
import './App.css';

//se importan los componentes
import CompShowEnterprises from './pages/Home/Home';

function App() {

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <CompShowEnterprises></CompShowEnterprises>
    </div>
  );
}

export default App;
